const Mycalorie = () => {
    const handleClickInsert = () => {
        window.location.replace("/mycalorieinsert")
    }
    const handleClickView = () => {
        window.location.replace("/mycalorieview")
    }

    return (
        <div className="flex space-x-20 space-y-10 justify-center ">
            <div className="flex" onClick={handleClickInsert}>
                <div className="flex w-80 h-80 rounded-full bg-white border-4 border-orange-200 justify-center items-center font-bold text-3xl">
                    내 식단 입력
                </div>
            </div>
            <div className="flex" onClick={handleClickView}>
                <div className="flex w-80 h-80 rounded-full bg-white border-4 border-blue-200 justify-center items-center font-bold text-3xl">
                    내가 섭취한 칼로리
                </div>
            </div>
        </div>
    ); 
}

export default Mycalorie
